package uz.coder.dagger2example.database.daoimport androidx.room.Daoimport androidx.room.Insertimport androidx.room.Queryimport uz.coder.dagger2example.database.entity.UserEntity@Daointerface UserDao {    @Insert    suspend fun insertUser(userEntity: UserEntity)    @Query("select * from UserEntity")    suspend fun getUsers():List<UserEntity>    @Insert    suspend fun insertAll(list: List<UserEntity>)}